import Sidebar from './Sidebar';
import Tweets from './Pages/Tweets';
import MyPage from './Pages/MyPage';
import About from './Pages/About';
// TODO - import문을 이용하여 MyPage, About 컴포넌트를 불러오세요.

const App = () => {
  return (
    <div>
      <BrowserRouter>
      {/* TODO - BrowserRouter 컴포넌트를 작성합니다. */}
        <div className="App">
          <main>
            <Sidebar />
            <section className="features">
              {/* TODO - Switch와 Route 컴포넌트를 이용하여 경로(path)를 설정하고 Tweets, Mypage, About 컴포넌트를 연결합니다. */}
        <Switch>
          <Route exact path="/">
            <Tweets />
          </Route>
          <Route path="/about"> {/* 경로를 설정하고 */}
            <About /> {/* 컴포넌트를 연결합니다. */}
          </Route>
          <Route path="/mypage"> {/* 경로를 설정하고 */}
            <MyPage /> {/* 컴포넌트를 연결합니다. */}
          </Route>
        </Switch>
            </section>
          </main>
        </div>
      </BrowserRouter>
    </div>

  );
};

// ! 아래 코드는 수정하지 않습니다.
export default App;
